【商品について】<br /><br />※物干し竿はこの商品に含まれておりません※<br />■サイズ：<br />（約）：幅9×奥行34～60×高さ210～300cm<br />・伸縮ロック機能内蔵<br />■素材：ステンレス<br />・竿受けは直径40mmまでの竿を入れることが可能<br />・高さを自由に調整できる竿受け（伸縮性でシーツも干せる）<br />・取り付け可能竿数（最大）4本<br />■その他：<br />・生産国：中国<br />・梱包サイズ：（約）16×9×114cm<br />・耐荷重：約30kg（竿1本につき約8kg）（竿受け1組につき約15kg）<br />・お客様組み立て商品です<br /><BR><FONT color="#ff0000" size="+2">※在庫状況や返品などについて </FONT><BR>
こちらの商品はメーカー直送商品となります。ご注文いただいてからメーカーへ在庫確認をいたしますので、
<BR>ご注文した後にメーカーに在庫がない場合は、予めご了承くださいませ。<BR><BR>
※<FONT color="#ff0000" size="+2">送料について</FONT><BR>
北海道・沖縄・離島については、別途送料お見積りとなります。<BR>
